import './styles.css';

import ResumoCard from 'components/ResumoCard';
import { Edificio } from 'types/edificio';

type Props = {
  edificio: Edificio;
};

const EdificioCard = ({ edificio }: Props) => {
  return (
    <div className="base-card patologia-card">
      <div className="card-top-container">
        <img src={EdificioImg} alt="Patologia" />
      </div>
      <div className="card-bottom-container">
        <h6>Edifício</h6>
        <p>
          <ResumoCard descricao="Descrição sumária" />
        </p>
      </div>
    </div>
  );
};

export default EdificioCard;
